option.value:
In Kotlin, the typical way to define a constant or a field that cannot be changed after initialization in a data class is to use the `val` keyword. By using `val` instead of `var`, you are indicating that the property should be read-only and cannot be modified after the object is created.

Here is an example:

```kotlin
data class User(
    val id: Int,         // This field is constant
    val name: String,    // This field is constant
    var email: String    // This field can be modified
)

fun main() {
    val user = User(id = 1, name = "Alice", email = "alice@example.com")

    // Trying to modify 'id' or 'name' will result in a compilation error
    // user.id = 2           // Compilation error
    // user.name = "Bob"     // Compilation error

    // Modifying 'email' is allowed
    user.email = "new.email@example.com"
    println(user)
}
```

Explanation:
- `val id: Int` and `val name: String` are defined as read-only properties, making them constant once the object is initialized.
- `var email: String` is a mutable property that can be changed after initialization.

This way, `id` and `name` fields in the `User` data class will stay constant and cannot be altered after an object of `User` is created.

