If you want certain fields in a Kotlin data class to have the same constant value across all instances of the class, you can use `companion object` to define those constants. However, these will be class-level constants, not instance-specific fields.

If you still want to include these fields in each instance but ensure they have the same value by default and cannot be changed, you can assign them default values and make them `val`.

Here's an example of how you can do this:

```kotlin
data class User(
    val id: Int,                     // Instance-specific constant
    val role: String = DEFAULT_ROLE, // Shared constant with default value
    var email: String                // Mutable field
) {
    companion object {
        const val DEFAULT_ROLE = "user" // Class-level constant
    }
}

fun main() {
    val user1 = User(id = 1, email = "alice@example.com")
    val user2 = User(id = 2, email = "bob@example.com")

    // Trying to modify 'role' will result in a compilation error
    // user1.role = "admin" // Compilation error

    println(user1) // Output: User(id=1, role=user, email=alice@example.com)
    println(user2) // Output: User(id=2, role=user, email=bob@example.com)
}
```

In this example:
- The `role` field is given a default value of `"user"` and is defined as a `val` to make it read-only.
- The `DEFAULT_ROLE` constant is defined in the `companion object`, making it accessible without an instance of `User`.

With this setup, every instance of `User` will have the same default value for `role`, but it will still be an instance-specific field that cannot be changed after initialization.

