To use a custom field inside an enum for serialization and deserialization in Kotlin, you should define a property in the enum class that holds the custom value. When using libraries like Jackson or Moshi for JSON serialization/deserialization, you can customize the behavior using annotations or custom serializers.

Here is an example using the Jackson library:

1. **Define the Enum with a Custom Field**:
```kotlin
import com.fasterxml.jackson.annotation.JsonCreator
import com.fasterxml.jackson.annotation.JsonValue

enum class Status(@get:JsonValue val value: String) {
    ACTIVE("active-status"),
    INACTIVE("inactive-status");

    companion object {
        @JsonCreator
        @JvmStatic
        fun fromValue(value: String): Status? {
            return values().firstOrNull { it.value == value }
        }
    }
}
```

2. **Use Jackson for Serialization/Deserialization**:
```kotlin
import com.fasterxml.jackson.module.kotlin.jacksonObjectMapper
import com.fasterxml.jackson.module.kotlin.readValue

data class User(val name: String, val status: Status)

fun main() {
    val objectMapper = jacksonObjectMapper()

    // Serialize
    val user = User(name = "Alice", status = Status.ACTIVE)
    val jsonString = objectMapper.writeValueAsString(user)
    println(jsonString)  // {"name":"Alice","status":"active-status"}

    // Deserialize
    val jsonResponse = """{"name":"Bob","status":"inactive-status"}"""
    val deserializedUser: User = objectMapper.readValue(jsonResponse)
    println(deserializedUser)  // User(name=Bob, status=INACTIVE)
}
```

### Explanation:

1. **Enum Definition**:
    - The `@JsonValue` annotation is used on the `value` property to indicate that this is the value that should be used during serialization.
    - The `fromValue` method in the companion object is annotated with `@JsonCreator` to specify that this method should be used to create an enum from the custom value during deserialization.

2. **Serialization/Deserialization Using Jackson**:
    - The `jacksonObjectMapper` is used to serialize and deserialize the data.
    - During serialization, the custom field (`value`) is used to represent the enum.
    - During deserialization, the `fromValue` method is used to convert the JSON string back to the enum.

By following this approach, you ensure that your custom field (`value` in this case) is used for both serialization and deserialization of the enum.

