is it possible in a nice kotlin way to do filter, and if the filter filters out some vcalues, to log them?
Such as .filter{ it.shouldFilter (do log if filtered}
Or do I have to do .filter{ val filtered = it.shouldFIlter if (filtered) log... filtered}?

Yes, there is a way to achieve filtering and logging in a succinct and idiomatic Kotlin way. Kotlin's `also` and `apply` scope functions can help in accomplishing this cleanly. Here is how you can do it:

```kotlin
val filteredList = list.filter {
    val shouldFilter = it.shouldFilter()
    if (shouldFilter) {
        println("Filtered out: $it") // Your logging logic here
    }
    !shouldFilter
}
```

In the above example, the `filter` function iterates over each element. Within the lambda, `it.shouldFilter()` is evaluated, and if it's `true`, the element is logged. The lambda returns `!shouldFilter`, so elements for which `shouldFilter` is `true` are excluded from the resulting list.

Alternatively, you can use the `also` function for more compact code:

```kotlin
val filteredList = list.filter { element ->
    element.shouldFilter().also { shouldFilter ->
        if (shouldFilter) {
            println("Filtered out: $element") // Your logging logic here
        }
    }.not()
}
```

Here, `also` allows us to perform the side effect of logging if `shouldFilter` is `true`, while still returning the result of the `shouldFilter` check inverted for the `filter` function.

Both approaches are idiomatic and keep the code clean and readable. Choose the one that you find most readable and maintainable for your specific use case.

