Certainly! You can create a generic lambda function to handle the logging, and then use it with `also` in your filtering logic. Here's how you can define and use such a lambda function:

```kotlin
data class Item(val id: Int, val isOfferable: Boolean)

fun main() {
    val list = listOf(
        Item(1, true),
        Item(2, false),
        Item(3, true),
        Item(4, false),
    )

    // Define the lambda function
    val logMissing: (Item) -> Boolean = { item ->
        if (!item.isOfferable) {
            println("Item with id: ${item.id} was filtered out due to not being offerable")
        }
        item.isOfferable
    }

    // Use the lambda function in the filter
    val filteredList = list.filter { item ->
        logMissing(item)
    }

    println("Filtered List: $filteredList")
}
```

In this example:
- The `logMissing` lambda function checks if an `Item` is not offerable. If it's not, it logs the `Item`'s `id` and returns `false`; otherwise, it returns `true`.
- This function can be reused in multiple places.
- The filter operation uses the `logMissing` lambda to both filter and log the items as needed.

If you want to use `also` for this, you can modify the lambda slightly:

```kotlin
data class Item(val id: Int, val isOfferable: Boolean)

fun main() {
    val list = listOf(
        Item(1, true),
        Item(2, false),
        Item(3, true),
        Item(4, false),
    )

    // Define the lambda function
    val logMissing: (Item) -> Unit = { item ->
        if (!item.isOfferable) {
            println("Item with id: ${item.id} was filtered out due to not being offerable")
        }
    }

    // Use the lambda function within also in the filter
    val filteredList = list.filter { item ->
        item.isOfferable.also { isOfferable ->
            if (!isOfferable) {
                logMissing(item)
            }
        }
    }

    println("Filtered List: $filteredList")
}
```

In this modified version:
- The `logMissing` lambda is defined as a `Unit` returning function.
- Within the `also` block, the `logMissing` lambda is called if the item is not offerable.

Both approaches should give you the desired result while maintaining readability and reusability.

