It seems like your tests might be picking up the wrong configuration file (`application.yml` for production) instead of the intended test configuration. This is a common issue and often arises due to misconfiguration of the classpath or test setup.

Here are some steps to troubleshoot and resolve this issue:

1. **Check Your Classpath:**
   Ensure that the test configuration file (`application.yml` for tests) is located in the correct test resources directory. Typically, this should be `src/test/resources` for a standard Maven/Gradle project structure.

2. **Spring Boot Test Configuration:**
   If you are using Spring Boot, ensure that your test configuration is being loaded properly. You can use the `@TestPropertySource` annotation or `@SpringBootTest` with custom properties to load the correct configuration file.

   Example using `@TestPropertySource`:
   ```java
   @RunWith(SpringRunner.class)
   @SpringBootTest
   @TestPropertySource(locations = "classpath:application-test.yml")
   public class MyServiceTest {
       // Your test cases
   }
   ```

   Example using `@SpringBootTest`:
   ```java
   @RunWith(SpringRunner.class)
   @SpringBootTest(properties = "spring.config.location=classpath:/application-test.yml")
   public class MyServiceTest {
       // Your test cases
   }
   ```

3. **Profiles:**
   Use Spring Profiles to manage different configurations for different environments. Define different profiles, e.g., `application-prod.yml` for production and `application-test.yml` for tests.

   Then activate the `test` profile in your test classes:
   ```java
   @RunWith(SpringRunner.class)
   @SpringBootTest
   @ActiveProfiles("test")
   public class MyServiceTest {
       // Your test cases
   }
   ```

   And make sure the `application-test.yml` file is in `src/test/resources`.

4. **Maven/Gradle Configuration:**
   Ensure your build tool is properly configured to include test resources during test runs. For example, in Maven, ensure the `maven-surefire-plugin` is configured correctly.

5. **Logs and Debugging:**
   Check the logs during your test runs to see which configuration files are being loaded. Spring Boot typically logs this information at startup. Use this to verify if the correct configuration file is being picked up.

6. **Spring Config Location Property:**
   You can explicitly set the location of the configuration file in the `application.properties` or using the `spring.config.location` property. This can help ensure the correct file is being used:
   ```properties
   spring.config.location=classpath:/application-test.yml
   ```

By following the above steps, you should be able to ensure that your tests are using the correct `application.yml` configuration. If the issue persists, please provide more details about your project setup, and I can help further diagnose the problem.

